@le_Parisien C'est tout simplement honteux ! Les personnes refusant l' #AstraZeneca devraient être interdits d'autres #vaccins  #Pfizer #Moderna 
C'est du grand délire !
Des médecins jettent des doses, mais où va -t-on dans ce pays ? #vaccination #vaccin #COVID19 #coronavirus

@christopheconte C'est énorme j'ai 56 ans et du diabète donc j'ai été prioritaire et j'ai été vacciné avec astrazeneca en pharmacie vue qu'au moment où j'ai été appelé il n'y avait ni pfizer ni moderna.
Maintenant on nous parle de trombose et donc plus d'astrazeneca pour les moins de 55 ans.
1/2

@AdelineDupuis4 Si vous n’avez pas de comorbidités vous n’êtes pas encore dans la cible.
Actuellement plus de 55 ans.
Les enseignants plus jeunes vont certainement être vaccinés plus tôt que les autres mais il faut encore  patienter. D’autant que vous ne pouvez pas avoir Astrazeneca.
